hared with Hero Honda. (Share Price 4K)'),('Auto - 2 & 3 Wheelers','Tube Investments of India Limited','TIINDIA','1','Tube Investments of India Limited (Part of Muruguppa group - eid parry (sugar), coromandel fertilizers, cholamandalam investment & finance - NBFC, chola ms general insurance jv with MS sumitomo of Japan (worlds 5th largest in insurance) etc, Second largest cycle manufacturer in India : BSA/Hercules after unlisted Hero Cycles). Covered in auto : 2 & 3 wheeler. Demerger ... TI Financial holdings (TI FH) for financial stuff like MS Chola etc ... and TI India limited (TI IL) - manufacturing of bycycle, auto parts etc Covered in auto : 2 & 3 wheeler. Present in MISC Category.'),('Auto - 2 & 3 Wheelers','TVS Motor','TVSMOTOR','1','TVS Motor Company (Flagship company of TVS group. TV Sundaram group. TVS-Suzuki alliance was over in 2001. The parent company is  Sundaram Clayton Ltd formed as a JV between Sundaram and Clayton group UK). In 1980, TVS 50, India\'s first two-seater moped was produced in Hosur.'),('Auto - Cars & Jeeps','Mahindra & Mahindra','M&M','1','Mahindra & Mahindra (Diversified Auto Giant, Car, Tractor etc). M&M is a holding company for Mahindra for so many subsidiary companies. (listed in auto)'),('Auto - Cars & Jeeps','Maruti Suzuki','MARUTI','1','Maruti Suzuki (Global Auto giant, Share price : 5K)'),('Auto - LCVs & HCVs','Ashok Leyland','ASHOKLEY','1','Ashok Leyland (Hinduja Group Company): 2nd largest Commercial Vehicle manufacturer in India. Largest bus manufacturer in the world. Presence in the defense also.'),('Auto - LCVs & HCVs','Eicher Motors','EICHERMOT','1','Eicher Motors (Royal Enfield Bikes, Joint collaboration with Volvo for trucks and buses, Sold tractor business to TAFE - Messey Ferguson assembler in India. TAFE is owned by Amalgmation group. Privately held.) High Share Price: 30K'),('Auto - LCVs & HCVs','Tata Motors','TATAMOTORS','1','Tata Motors (World leader in automobile)'),('Auto - LCVs & HCVs','SML ISUZU','','0','SML I