gation','JISLJALEQS','1','Jain Irrrigation Systems  (leader in agri input and pipes, diversified player)'),('Plastics','Nilkamal','NILKAMAL','1','Nilkamal (Home furniture of plastics, world\'s largest manufacturer of moulded furniture and Asia\'s largest processor of plastic moulded products) : Share Price 2K'),('Plastics','Supreme Industries','SUPREMEIND','1','Supreme Industries (complete plastic portfolio)'),('Plastics','VIP Industries','VIPIND','1','VIP Industries (world\'s second largest luggage maker, VIP, Alfa, Aristocrat, SkyBags, Caprese, Carlton) : High Brand Recall, Strong Distribution network.'),('Plastics','Prince Plastics','','0','Prince plastics : Small player right now.'),('Power - Generation & Distribution','Adani Transmission ','ADANITRANS','1','Adani transmission is the largest private player in power transmission sector. After the sector was opened for private player, it competes with Power Grid. Other major players are KEC international (RPG group company), Kalpatru power transmission, Sterlite power, Essel Infra etc. Not easy business but long leases are available for using. Power theft is another concern.'),('Power - Generation & Distribution','NHPC ','NHPC','1','NHPC (National Hydro power corporation ) - CPSE'),('Power - Generation & Distribution','NLC India','NLCINDIA','1','NLC India (Neyveli Lignite corp) - CPSE Navaratna'),('Power - Generation & Distribution','NTPC ','NTPC','1','NTPC - CPSE Maharatna'),('Power - Generation & Distribution','Power Grid Corp ','POWERGRID','1','Power Grid Corp - CPSE, India\'s biggest power grid and transmission company.'),('Power - Generation & Distribution','Tata Power','TATAPOWER','1','Tata Power - Integrated power player. In different types of power generation.'),('Power - Transmission & Equipment','GE Power India','GEPIL','0','GE Power India (GE acquired energy assets of Alstom, French energy major, and renamed Alstom India to GE Power India)'),('Power - Transmission & Equipment','GE T&D India','GET&D','0'